import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const inputRange = document.querySelector('input[type="range"]');
    console.log(inputRange);
  });

  return (
    <>
      <input type="range" name="" id="nbreInput" min="2" max="10" value="2" />
      <input
        type="text"
        name=""
        id=""
        value="21"
        readOnly
        onChange="document.querySelector('#nbreInput').value = this.value"
      />
    </>
  );
};

export default App;
